  13,\n\t\"tags\": [],\n\t\"title\": \"Nitrogen content and delta N-15 of marine algae
  and associated waters of Maui, Hawaii from 2012-07-28 to 2014-04-01. (NCEI Accession
  0156294)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-08-15T20:27:02.674414\",\n\t\"name\":
  \"nitrogen-content-and-delta-n-15-of-marine-algae-and-associated-waters-of-maui-hawaii-from-2012-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set includes nutrient data related
  to algal and water samples collected between 2012 and 2014 on Maui, Hawaii. Algal
  tissue N%, C:N ratios, and delta N-15 values are reported for three species collected
  and or deployed at six study locations (Kahului Bay, Waiehu Bay, Kuau Bay, Honomanu
  Bay, Maalaea Bay, and Honolua Bay). Water was sampled from marine surface waters,
  streams, wells, coastal groundwater (beach porewater) and springs at many sites
  on Maui. We report the location, salinity, total nitrogen, total phosphorous, nitrate,
  nitrite, phosphate, ammonium, dissolved inorganic nitrogen and delta N-15 of these
  water samples. In addition, we include a summary of benthic analyses including estimates
  of the proportion of benthic cover and calculations of diversity for all six study
  locations listed above.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
